import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <div className="wrapper">
        <Link href="/">
          <a className="navlink">Home</a>
        </Link>
        <Link href="/about">
          <a className="navlink">About</a>
        </Link>
      </div>
    </div>
    <style jsx>
      {`
        .navbar {
          display: block;
          position: relative;
          margin: 40px 0;
        }

        .navlink {
          letter-spacing: 2px;
          text-transform: uppercase;
          background: #369;
          color: #fff;
          padding: 5px 10px;
          margin: 0 0 10px 0;
          line-height: 24px;
        }

        .navlink:hover {
          opacity: 0.6;
        }
      `}
    </style>
  </>
);

export default Header;
